import web3 from './web3';
import CreateLottery from './build/CreateLottery.json';

const instace = new web3.eth.Contract(
    JSON.parse(CreateLottery.abi),
    '0x4d8c7c456713Cd041ebFf91466A437081B18304A'
);

export default instace;
